import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };
  return (
    <div className="app-container">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Dashboard</h2>
        <button onClick={handleLogout} className="btn btn-danger">Logout</button>
      </div>
      <nav className="nav justify-content-center mb-4">
        <Link to="/add-agent" className="nav-link">Add Agent</Link>
        <Link to="/upload-list" className="nav-link">Upload List</Link>
        <Link to="/agent-lists" className="nav-link">Agent Lists</Link>
      </nav>
    </div>
  );
}
export default Dashboard;
